-- QLD_RTO_Locations definition


CREATE TABLE `QLD_RTO_Locations` (
  `rtoID` int(11) NOT NULL,
  `rtoName` varchar(100) DEFAULT NULL,
  `rtoAddress` varchar(100) DEFAULT NULL,
  `latitude` decimal(10,8) NOT NULL,
  `longitude` decimal(11,8) NOT NULL,
  PRIMARY KEY (`rtoID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

